import React from "react";
import styled from "styled-components";
import Profile from "./Profile";
const wrapper = styled`
  display: block;
  flex: 1 1;
  backgroud: #ffff;
height :500vh;
`;

function home(props) {
  return (
    <wrapper>
      <div>
        <Profile />
      </div>
    </wrapper>
  );
}

export default home;
